import './App.css';

function App() {
  return (
    <div className="App">

      <div className="header">
        <div className="nav">
          <ul>
        <h1>I Am a Web Designer</h1>
        <li className="links">About</li>
        <li className="links">project</li>
        <li className="links">Education</li>
        <li className="links">Resume</li>
        <li className="links">Contect</li>
        </ul>
        </div>
      </div>

      <div className="header"> 
        <img className="headerImage" src="https://cdnb.artstation.com/p/assets/images/images/012/521/703/large/alper-alkan-gadin-3.jpg?1535207487"/>
      </div>
    </div>
  );
}

export default App;
